import './trade-mini.css';

function TradeMini (tradeInfo) {
    return (
        <div className="mini">
         <img />
         <div className="tradeInfo">
           <p>{tradeInfo.user1}</p>
         </div>
         <img />
        </div>
    )
}

export default TradeMini;
